public List<HttpsJwks> getHttpsJwks() {
  if (httpsJwks == null) {
    if (httpsJwksFactory == null) {
      httpsJwksFactory = new HttpsJwksFactory(3600, DEFAULT_REFRESH_REPRIEVE_THRESHOLD);
